  let title = 'Title';
  const changeTitle = () => {
    title = 'Title has changed';
    console.log(title);
  }
  return (
    <div className="mx-auto">
      <h1>{title}</h1>
      <h2>{title}</h2>
      <h3>{title}</h3>
      <button>Change Title</button>
    </div>
  )
}

